import React, { useEffect } from 'react';

function ListView() {

    useEffect(() => {
        // Fetch all cars from the backend
        axios.get('/api/cars')
          .then(response => {
            setCars(response.data);
          })
          .catch(error => {
            console.error('There was an error fetching the cars!', error);
          });
      }, []);
  return (
    <div>
      <h1>Car List</h1>
      <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>Model</th>
            <th>Basic Amount</th>
            <th>Tax Amount</th>
            <th>Max Amount</th>
          </tr>
        </thead>
        <tbody>
          {cars.map((car, index) => (
            <tr key={index}>
              <td>{car.name}</td>
              <td>{car.model}</td>
              <td>{car.basicAmount}</td>
              <td>{car.tax}</td>
              <td>{car.maxAmount}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default ListView;
